import React from 'react';

export default function Timeline() {
  return (
    <div className="card" role="region" aria-labelledby="gantt-title">
      <h2 id="gantt-title">Timeline (Gantt) - Placeholder</h2>
      <p>This uses a placeholder. For production we'd integrate a Gantt library with ARIA considerations.</p>
    </div>
  );
}
